import mss
import cv2
import numpy as np
import pyautogui
import threading
import time
import keyboard
import getopt
import sys
import os
import base64
from PIL import Image
import io

screenshot = None
elements = {}

def get_raw_image(image):
    raw_images = {
        "golden_cookie_raw_image": b'',
        "cookie_raw_image": b''
    }
    return raw_images[image]

def set_interval(func, time):
    e = threading.Event()
    while not e.wait(time):
        func()

def decode_image(raw_img):
    return np.array(Image.open(io.BytesIO(base64.b64decode(raw_img))))

def image_search(template, precision):
    with mss.mss() as sct:
        img = screenshot
        img_rgb = np.array(img)
        img_gray = cv2.cvtColor(img_rgb, cv2.COLOR_BGR2GRAY)
        template.shape[::-1]
        res = cv2.matchTemplate(img_gray, template, cv2.TM_CCOEFF_NORMED)
        min_val, max_val, min_loc, max_loc = cv2.minMaxLoc(res)
        if max_val < precision:
            return [-1, -1]
        return max_loc

def set_element(elem):
    global elements

    elements[elem] = {}
    elements[elem][elem + "_image"] = decode_image(get_raw_image(elem + "_raw_image"))
    elements[elem][elem + "_template"] = cv2.cvtColor(elements[elem][elem + "_image"], cv2.COLOR_BGR2GRAY)

def search_cookie():
    cookie_image = elements["cookie"]["cookie_image"]
    cookie_template = elements["cookie"]["cookie_template"]
    height, width, channels = cookie_image.shape

    pos = image_search(cookie_template, .35)
    if pos[0] != -1:
        print("Clicking cookie...")
        pyautogui.moveTo(pos[0] + width / 2, pos[1] + height / 2, 0)
        pyautogui.click(button="left")

def search_golden_cookie():
    golden_cookie_image = elements["golden_cookie"]["golden_cookie_image"]
    golden_cookie_template = elements["golden_cookie"]["golden_cookie_template"]
    height, width, channels = golden_cookie_image.shape

    pos = image_search(golden_cookie_template, .5)
    if pos[0] != -1:
        print("[!] Found Golden Cookie!")
        pyautogui.moveTo(pos[0] + width / 2, pos[1] + height / 2, 0)
        pyautogui.click(button="left")
        return True
    return False

def start_tui():
    print("##################################################")
    print("###########                            ###########")
    print("###########     Cookie Clicker Bot     ###########")
    print("###########                            ###########")
    print("##################################################\n\n")
    print("This Bot is automated to click on the Cookie and Golden Cookies. It will make use of your mouse, so once the bot is running head to the Cookie Clicker game and AFK since you're PC will be occupied.\n")
    print("- Terminating script: If you're on Windows, try holding 'q' to quit. If you're on Linux, you may find a way to succeed.")
    print("[*] It seems you're using Windows, so terminating with key press should work as intended" if os.name == "nt" else "[*] It seems you're on a UNIX based system, you so might encounter it a bit hard to quit.\n")
    print("- Arguments: The following arguments are available")
    print("    --slow: It will comsume less resources from your PC, but it'll click slower (3 clicks/s)")

def init():
    start_tui()
    input("\nPress enter to start...")
    clean_terminal()
    for elem in ["cookie", "golden_cookie"]:
        print(f'Defining object "{elem}"...')
        set_element(elem)

def clean_terminal():
    os.system('cls' if os.name == 'nt' else 'clear')

def grab_screen():
    global screenshot
    with mss.mss() as sct:
        screenshot = sct.grab(sct.monitors[0])

def core():
    grab_screen()
    if search_golden_cookie():
        return
    search_cookie()

def handle_exit():
    if keyboard.is_pressed('q'):
        sys.exit()

def handle_args(argv):
    slow = False

    print("Handling arguments...")
    for arg in argv:
        if arg == "--slow":
            print("[*] Detected --slow")
            slow = True
    if not slow:
        print("No arguments encountered")
    print("Searching for cookies to click...")
    return slow


def main(argv):
    init()
    slow = handle_args(argv)
    set_interval(core, .1 if not slow else .3)
    set_interval(handle_exit, .1)

if __name__ == "__main__":
    main(sys.argv[1:])
